import React from 'react';
import {Component} from 'react';
import {connect} from 'react-redux';

class Registration extends Component{
  constructor(props){
    super(props);
    this.state = {days:[], months:[], years:[]};
  }
  componentDidMount(){
    for(let i=1; i<31; i++){
      this.state.days.push(i);
    }
    this.setState({days: this.state.days});
  }
  render(){
    let listDays = this.state.days.map((item, key) =>{
      return <option value={item} key={key}>{item}</option>
    })
    return (
      <div className="singWrap">
        <form class='autorisationWrap registr' action="">
            <h1>Registration</h1>
            <input type="text" class="loginData" placeholder="Firstname"/>
            <input type="text" class="loginData" placeholder="Email"/>
            <div class="loginData selectDateWrap">
              <select class="selectDate" name="">
                <option value="">1</option><option value="">2</option><option value="">3</option><option value="">4</option><option value="">5</option><option value="">6</option><option value="">7</option><option value="">8</option><option value="">9</option>
                <option value="">10</option><option value="">11</option><option value="">12</option><option value="">13</option><option value="">14</option><option value="">15</option><option value="">16</option><option value="">17</option><option value="">18</option>
                <option value="">19</option><option value="">20</option><option value="">21</option><option value="">22</option><option value="">23</option><option value="">24</option><option value="">25</option><option value="">26</option><option value="">27</option>
                <option value="">28</option><option value="">29</option><option value="">30</option><option value="">31</option>
              </select>
              <select class="selectDate" name="">
                <option value="">January</option><option value="">February</option><option value="">March</option><option value="">April</option>
                <option value="">June</option><option value="">July</option><option value="">August</option><option value="">September</option>
                <option value="">January</option><option value="">October</option><option value="">November</option><option value="">December</option>
              </select>
              <select class="selectDate" name="">
                <option value="">2003</option><option value="">2002</option><option value="">2001</option>
                  <option value="">2000</option><option value="">1999</option><option value="">1998</option>
                    <option value="">1997</option><option value="">1996</option><option value="">1995</option>
              </select>
            </div>
            <input type="text" class="loginData" placeholder="Password"/>
            <input type="text" class="loginData" placeholder="Password again"/>
            <input type="submit" class='logInput regInput' value='REGISTRATE'/>
        </form>
      </div>
    )
  }
}

export default Registration;
